// frontend/src/components/common/Header.tsx

import React from 'react';

const Header: React.FC = () => {
  return (
    <div className="header">
      <h1>💪 헬스장 회원관리 시스템</h1>
      <p>스케줄 관리 및 회원 정보 관리 시스템</p>
    </div>
  );
};

export default Header;
